import React from 'react';
import CategoryPage from '../../components/CategoryPage';
import { juiceImages } from '../../assets/images';

const products = [
  {
    id: 1,
    name: 'Immunity Booster',
    description: 'Orange, Ginger, Carrot blend with fresh mint - Rich in Vitamin C',
    price: '$7.99',
    image: juiceImages.immunityBooster.src,
    ingredients: juiceImages.immunityBooster.ingredients,
    benefits: juiceImages.immunityBooster.benefits,
  },
  {
    id: 2,
    name: 'Green Detox',
    description: 'Spinach, cucumber, apple, and ginger blend',
    price: '$6.99',
    image: 'https://source.unsplash.com/400x300/?green-juice',
  },
  {
    id: 3,
    name: 'Berry Blast',
    description: 'Mixed berries with apple base',
    price: '$8.99',
    image: 'https://source.unsplash.com/400x300/?berry-juice',
  },
  {
    id: 4,
    name: 'Beetroot Energizer',
    description: 'Beetroot, apple, and ginger juice',
    price: '$7.99',
    image: 'https://source.unsplash.com/400x300/?beetroot-juice',
  },
];

function HealthyJuices() {
  return (
    <CategoryPage
      title="Healthy Juices"
      description="Discover our range of freshly pressed juices made from organic fruits and vegetables. Each juice is carefully crafted to provide maximum nutrition and taste."
      products={products}
    />
  );
}

export default HealthyJuices;
